import { Col } from "react-bootstrap";

export const ProjectCard = ({ title, description, imgUrl, link }) => { // Add link here
    const randomDelay = Math.random() * 2;
    return (
        <Col sm={6} md={4}>
            <div className="proj-imgbx" style={{ animationDelay: `${randomDelay}s` }}>
                <a href={link} target="_blank" rel="noopener noreferrer">  {/* Add this line */}
                    <img src={imgUrl} alt={title} />  {/* Add alt attribute for accessibility */}
                </a>
                <div className="proj-txtx">
                    <h4>{title}</h4>
                    <span>{description}</span>
                </div>
            </div>
        </Col>
    )
}
